webpackJsonp([23943990870746],{5146:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/10/mosssfront.jpg" height="263" width="350" border="0" alt="mosssfront.jpg: " /></p>\n<p>Christopher Ryan \'Randy\' Moss is dressed up for Monday Night Football tonight.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/10/mosssback.jpg" height="467" width="350" border="0" alt="mosssback.jpg: " /></p>\n<hr />\nI see the weblog is on still on European time, so the date says Monday, even though it\'s still Sunday evening here in west-central Minnesota. We\'ve got pictures from both Arizona and Minnesota at "photopoint".</p>\n<p>We\'ve both had fun watching the baseball divisional playoffs, especially knowing about the fervent Mariners and Mets fans in the editthispage audience. </p>\n<p>But back home, I see Germany defeated England 1-0 at Wembley. I\'ll take a World Cup over a World Series anytime.</p>',fields:{title:"Monday Night",date:"09 Oct 2000",url:"https://papascott.de/2000-10-09-monday-night/"}}},pathContext:{slug:"/2000-10-09-monday-night/",prev:{fields:{title:"Shades",date:"05 Oct 2000",slug:"/2000-10-05-shades/"}},next:{fields:{title:"Legion",date:"12 Oct 2000",slug:"/2000-10-12-legion/"}}}}}});
